package com.gemini.stack;

import java.util.Stack;

public class SimpleStack {

    public static void main(String[] args) {
        // TODO Auto-generated method stub

        Stack<Integer> st = new Stack<Integer>();
        
        st.push(1);
        st.push(2);
        st.push(3);
        st.push(4);
        
        System.out.println(st);
    }

}
